  false,\n\t\"url\": null,\n\t\"notes\": \"This group of Minnkohwin lakes, like the
  group of lakes surveyed last year farther west along Chalatna Creek has low waterfowl
  production. The two lake groups have similar \"thaw pond\" habitats and may be roughly
  compared: duck production on the western group of lakes in 1984 was.13 young/acre,
  and in 1985 on the Minnkohwin lakes production was.04 young/acre. This decrease
  in production on thaw ponds from 1984 to 1985 parallels the trend seen on the Kanuti
  and Koyukuk river drainages.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
